import "./Graph.css";

const Graph = ({level}) => {
    return(
        <div className="Graph">
            <div className="buttons">
                {level===1?<button className="color-1"autoFocus>1</button>:<button className="color-1">1</button>}
                <button className="color-2">2</button>
                <button className="color-3">3</button>
                <button className="color-4">4</button>
                <button className="color-5">5</button>
                <button className="color-6">6</button>
                <button className="color-7">7</button>
                <button className="color-8">8</button>
                <button className="color-9">9</button>
                <button className="color-10">10</button>
                <button className="color-11">11</button>
                <button className="color-12">12</button>
                {/* <button className="btn-hover color-13">13</button>
                <button className="btn-hover color-14">14</button>
                <button className="btn-hover color-15">15</button> */}
            </div>
        </div>
    );
}
export default Graph;
